import React from "react";

function Menu() {
    return (
        <div className="menu">
            <div>
                MENU
    </div>
            <div>
                <div>
                <div class="card">
  <img class = "imgcard" src="./images/breadwithsoup.svg" alt="Avatar"/>
  <div class="container">
    <h4><b>John Doe</b></h4>
    <p>Architect & Engineer</p>
  </div>
</div>
                </div>
            </div>

        </div>
    );
}

export default Menu;
